import React from 'react'
import { BUTTON_STYLES } from '../../assets/static/constants';

interface IButtonProps{
  buttonLabel: string;
  emphasis?: string;
}
interface IButtonState{
  type: string,
  text: string
}

class Button extends React.Component<IButtonProps, IButtonState>{

  constructor(props: IButtonProps){
    super(props);
    this.state = {
      type: 'Primary',
      text: props.buttonLabel
    }
  }

  static getButtonStyle = (_emphasis: string) => {
    return BUTTON_STYLES['PRIMARY']
  }

  render(){
    return (
      <>
        <button className={`w-1/2 m-8 h-10${getButtonStyle(this.props.emphasis)}  rounded-lg hover:-translate-y-0.5  duration-300`}>{this.state.text}</button>
      </>
    )
  }
}


export default Button
